import React, { useRef, useEffect, useState } from 'react';
import ReactPlayer from 'react-player';

const WatchPage = () => {
  const videos = [
    {
      id: 1,
      url: 'https://www.youtube.com/watch?v=KxaX-eYPjQw',
    },
    {
      id: 2,
      url: 'https://www.youtube.com/watch?v=d1_JKFy_fIk',
    },
    {
      id: 3,
      url: 'https://www.youtube.com/watch?v=d1_JKFy_fIk',
    },
    {
      id: 4,
      url: 'https://www.youtube.com/watch?v=d1_JKFy_fIk',
    },
    {
      id: 5,
      url: 'https://www.youtube.com/watch?v=d1_JKFy_fIk',
    },
    {
      id: 6,
      url: 'https://www.youtube.com/watch?v=KxaX-eYPjQw',
    },
    {
      id: 7,
      url: 'https://www.youtube.com/watch?v=d1_JKFy_fIk',
    },
    {
      id: 8,
      url: 'https://www.youtube.com/watch?v=d1_JKFy_fIk',
    },
    {
      id: 9,
      url: 'https://www.youtube.com/watch?v=d1_JKFy_fIk',
    },
    {
      id: 10,
      url: 'https://www.youtube.com/watch?v=d1_JKFy_fIk',
    },
    {
      id: 11,
      url: 'https://www.youtube.com/watch?v=KxaX-eYPjQw',
    },
    {
      id: 12,
      url: 'https://www.youtube.com/watch?v=d1_JKFy_fIk',
    },
    {
      id: 13,
      url: 'https://www.youtube.com/watch?v=d1_JKFy_fIk',
    },
    {
      id: 14,
      url: 'https://www.youtube.com/watch?v=d1_JKFy_fIk',
    },
    {
      id: 15,
      url: 'https://www.youtube.com/watch?v=d1_JKFy_fIk',
    },
  ];

  const videoRefs = useRef([]);
  const [playingVideos, setPlayingVideos] = useState([]);
  const [loadedVideos, setLoadedVideos] = useState(0);

  const handleError = (error) => {
    console.log('An error occurred:', error);
  };

  useEffect(() => {
    const handleIntersection = (entries) => {
      entries.forEach((entry) => {
        const videoId = entry.target.getAttribute('data-id');
        const isPlaying = playingVideos.includes(videoId);
        const videoRef = videoRefs.current.find(
          (ref) => ref.current.getAttribute('data-id') === videoId
        );

        if (entry.isIntersecting && !isPlaying) {
          if (videoRef && videoRef.current) {
            videoRef.current.getInternalPlayer().play();
          }
          setPlayingVideos((prevPlayingVideos) => [
            ...prevPlayingVideos,
            videoId,
          ]);
        } else if (!entry.isIntersecting && isPlaying) {
          if (videoRef && videoRef.current) {
            videoRef.current.getInternalPlayer().pause();
          }
          setPlayingVideos((prevPlayingVideos) =>
            prevPlayingVideos.filter((id) => id !== videoId)
          );
        }
      });
    };

    const observer = new IntersectionObserver(handleIntersection, {
      threshold: 0.5,
    });

    const refs = videoRefs.current;
    refs.forEach((ref) => {
      if (ref.current) {
        observer.observe(ref.current);
      }
    });

    return () => {
      refs.forEach((ref) => {
        if (ref.current) {
          observer.unobserve(ref.current);
        }
      });
    };
  }, [playingVideos, videoRefs]);

  useEffect(() => {
    if (loadedVideos === videos.length) {
      videoRefs.current.forEach((ref) => {
        if (ref.current) {
          ref.current.getInternalPlayer().play();
        }
      });
    }
    return () => {
      videoRefs.current.forEach((ref) => {
        if (ref.current) {
          ref.current.getInternalPlayer().pause();
        }
      });
    };
  }, [loadedVideos, videoRefs]);

  const handleLoad = () => {
    setLoadedVideos((prevLoadedVideos) => prevLoadedVideos + 1);
  };

  const shuffleVideos = (videos) => {
    for (let i = videos.length - 1; i > 0; i--) {
      const j = Math.floor(Math.random() * (i + 1));
      [videos[i], videos[j]] = [videos[j], videos[i]];
    }
    return videos;
  };

  const shuffledVideos = shuffleVideos(videos);

  return (
    <div className="max-w-screen max-h-screen overflow-auto">
      <div className="flex flex-wrap justify-center items-center mt-[60px]">
        {shuffledVideos.map((video, i) => (
          <div
            key={video.id}
            className="flex justify-center items-center mb-[45px] shadow-2xl rounded-2xl overflow-hidden"
          >
            <ReactPlayer
              ref={(ref) => (videoRefs.current[i] = ref)}
              data-id={video.id}
              url={video.url}
              playing={playingVideos.includes(video.id)}
              muted={true}
              autoPlay={false}
              onError={handleError}
              width="960px"
              height="540px"
              controls
              allowFullScreen={true}
              config={{
                youtube: {
                  playerVars: { showinfo: 1 },
                },
              }}
              onReady={handleLoad}
            />
          </div>
        ))}
      </div>
    </div>
  );
};

export default WatchPage;
